import React from "react";
import styles from "../css/Login.module.css";

const Login = () => {
  return (
    <div className={styles.LoginWrap}>
      <h3 className={styles.LoginLogo}></h3>
      <p>안녕하세요.</p>
      <p>김서준입니다.</p>
      <form action="" className={styles.LoginFormWrap}>
        <div className={styles.LoginEmailWrap}>
          <label htmlFor="loginEmail" className={styles.LoginEmailLabel}>
            email
          </label>
          <input type="email" id="loginEmail" className={styles.LoginEmail} />
        </div>

        <div className={styles.LoginPasswordWrap}>
          <label htmlFor="LoginPassword" className={styles.LoginPasswordLabel}>
            password
          </label>
          <input
            type="password"
            id="LoginPassword"
            className={styles.LoginPassword}
          />
        </div>

        <button className={styles.LoginSubmitButton}>로그인하기</button>
      </form>
    </div>
  );
};

export default Login;
